import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Cards from './Cards';
function Grid() {
  return (
    <Container>
      <Row>
        <Col><Cards/></Col>
        <Col><Cards/></Col>
        <Col><Cards/></Col>
        <Col><Cards/></Col>

      </Row><br />
      <Row>
        <Col><Cards/></Col>
        <Col><Cards/></Col>
        <Col><Cards/></Col>
        <Col><Cards/></Col>

      </Row>
    </Container>
  );
}

export default Grid;
